import "bootstrap/dist/css/bootstrap.min.css";

const TableTemplate = () => {


  return (
        <div className="container" style={{ width: "600px" }}>
          <div className="my-3">
          <form>
            <label>
              Name:
              <input type="text"/>
            </label>
            <input type="submit" value="Submit" />
          </form>
          </div>
        </div>
  );
};

export default TableTemplate;
